const ImgUpload = () => {
    return (
        <div>
            <h1 className="relative left-20 top-20 break-normal font-semibold text-4xl text-purple-900">This is the subcomponent for users to post images .</h1>
            <h1 className="relative left-20 top-30 break-normal font-semibold text-4xl text-purple-900">Kelly will work on this.</h1>
        </div>
    );
}
export default ImgUpload;
